import React from 'react';
import { createDrawerNavigator } from '@react-navigation/drawer';
import { NavigationContainer } from '@react-navigation/native';
import Home from './src/screens/Home';
import Settings from './src/screens/Settings';
import Menu from './src/screens/Menu';
import DrinkMenu from './src/screens/DrinkMenu'; // Nueva pantalla para el menú de bebidas
import NearbyStores from './src/screens/NearbyStores'; // Nueva pantalla para cafeterías cercanas
import Order from './src/screens/Order'; // Nueva pantalla para ordenar y pagar

const Drawer = createDrawerNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Drawer.Navigator initialRouteName="Home">
        <Drawer.Screen name="Home" component={Home} />
        <Drawer.Screen name="Menu" component={Menu} />
        <Drawer.Screen name="Settings" component={Settings} />
        <Drawer.Screen name="DrinkMenu" component={DrinkMenu} /> {/* Nueva opción */}
        <Drawer.Screen name="NearbyStores" component={NearbyStores} /> {/* Nueva opción */}
        <Drawer.Screen name="Order" component={Order} /> {/* Nueva opción */}
      </Drawer.Navigator>
    </NavigationContainer>
  );
}


